import React from 'react';
import DisplayComponents from './Components/DisplayComponents';
import btnComponents from './Components/btnComponent';
import './App.css';

function App() {
  return (
    <div className="main_section">
    <h1>hello</h1>
    <DisplayComponents/>
     <div className="clock-holder">
     <h1>hello</h1>
     <DisplayComponents/>
     <div className="stopwatch">
     <h1>hello</h1>
         <DisplayComponents/>
         <btnComponents/>
     </div>
    </div>
    </div>
  );
}

export default App;
